import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Home from '..components/Home'
import NotFound from './NotFound';

function Routes() {

    return (
    <Switch>
        <Route exact-path="/">
            <Home />
        </Route>
        <Route>
            <NotFound />
        </ Route>
    </Switch>
    );
}

export default Routes;
